import axios from "axios";
import "./App.scss";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import React from "react";
import Home from "./home";

function App() {

  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" Component={Home} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
